import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./Components/Pages/Navbar";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route Component={<Navbar/>} path="/"/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
